import React, { Component } from "react";
import { App } from "./App";
import { getWatchData } from "./DataPaths";

// const client = new Client();

// client.get();
// client.search(query);

class AppContainer extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
      loaded: false,
      placeholder: "Loading"
    };
  }

  componentDidMount() {
    fetch("http://localhost:8000/api/home/")
      .then(response => {
        if (response.status > 400) {
          return this.setState(() => {
            return { placeholder: "Something went wrong!" };
          });
        }
        return response.json();
      })
      .then(data => {
        this.setState(() => {
          return {
            data,
            loaded: true
          };
        });
      });
  }

  render() {
    // console.table(this.state.data.watch_data);
    // console.log("this is the listen data:");
    // console.table(this.state.data.listen_data);

    getWatchData().then(
      data => {
        const watchData = data["watch_data"];
        const listenData = data["listen_data"];
        console.table(watchData);
        console.table(listenData);
        console.log("returning app");
        return (
          <div>
            <App
              watchExperienceData={data["watch_data"]}
              listenExperienceData={data["listen_data"]}
            />
          </div>
        );
      },
      error => {
        return <div></div>;
      }
    );
    // return (
    //   <div>
    //     <App
    //       watchExperienceData={this.state.data.watch_data}
    //       listenExperienceData={this.state.data.listen_data}
    //     />
    //   </div>
    // );
  }
}

export default AppContainer;
